function initMapStaticLocation(n,t){let i=[42.7339,25.4858];if(t&&validateCoordinates(t)){const n=t.split(",").map(n=>parseFloat(n.trim()));n.length===2&&(i=n)}const r=L.map(n).setView(i,12);L.tileLayer("https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png",{attribution:""}).addTo(r);const u=L.marker(i).addTo(r).bindPopup("Garage location")}